import './App.css';
import AdditionalInfo from './components/AdditionalInfo';
import DateField from './components/DateField';
import PlaceChoiceFields from './components/PlaceChoiceFields'
import SendAndClear from './components/SendAndClear';

function App() {
  const mainWindowStyle = { backgroundColor: 'blue', height: '100vh', fontFamily: "'Exo 2', sans-serif", fontWeight: '600' };
  const elementsDivStyle = { display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', position: 'absolute', backgroundColor: 'brown', width: '70%', height: '80%', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', webkitTransform: 'translate(-50%, -50%)' };
  const mainElementsBoxStyle = { display: 'flex', flexDirection: 'column', backgroundColor: 'yellow', alignItems: 'center', gap: '50px', height: '100%' };
  const titleStyle = { fontSize: '30px', marginTop: '10%' }
  return (
    <div className='mainWindow' style={mainWindowStyle}>
      <div className="App" style={elementsDivStyle}>
        <div className="mainElementsBox" style={mainElementsBoxStyle}>
          <label style={titleStyle}>Форма бронирования переговорных комнат</label>
          <div style={{ backgroundColor: 'red', flex: '5.5', width: '80%' }}><PlaceChoiceFields /></div>
          <div style={{ backgroundColor: 'wheat', flex: '5.5', width: '80%' }}><DateField /></div>
          <div style={{ backgroundColor: 'magenta', flex: '16', width: '80%' }}><AdditionalInfo /></div>
          <div style={{ backgroundColor: 'magenta', flex: '4', marginBottom: '5%', width: '80%' }}><SendAndClear /> </div>
        </div>
      </div>
    </div >
  );
}

export default App;
